INSERT INTO `databaseInput_type` (`id`, `name`, `isModification`, `pfamName`, `pfamId`, `description`, `pfamGraphic`, `smashName`) VALUES (1,'A',0,'AMP-binding (+ AMP-binding C)','PF00501','Adenylation-Domain\r\nSpecific activation of amino acid by adenylation\r\nPfam recognises different domains even though it\'s only one.','{\"type\" : \"pfama\",\"text\" : \"A-Domain\",\"colour\" : \"#82FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",  \"endStyle\" : \"curved\"}','AMP-binding'),(2,'C',0,'Condensation','PF00668','Condensation Domain\r\nBuilds peptide bond between two amino acids, each covalenty bound to a thiolation domain. It has a specificity for the chirality of the donor amino acid and for the acceptor amino acid. Thus the latter specificity is the same as that of the following adenylation domain.\r\nPfam also recognises epimerisation domains as condensation domains.','{\"type\" : \"pfama\",\"text\" : \"C-Domain\",\"colour\" : \"#ff5353\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}',NULL),(3,'T',0,'PP-binding','PF00550','Thiolation Domain\r\nDomain covalently carrying amino acids and peptides via thioester bond.','{\"type\" : \"pfama\",\"text\" : \"T-Domain\",\"colour\" : \"#FF00FF\",\"display\" : \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','PCP'),(4,'TE',0,'','PF00975.13','Thioesterase Domain\r\nSynthesis terminating domain, which can introduce a heterocycle depending on the amino acid sequence.','{\"type\" : \"pfama\",\"text\" : \"TE-Domain\",\"colour\" : \"#0040FF\",\"display\" : \"true\",\r\n\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Thioesterase'),(5,'E',0,'Condensation','PF00668','Epimerisation Domain\r\nRacemises the amino acid to be introduced. Specificity for chirality given by condensation domain.\r\nAny sole condensation domain at the end of a synthesase in Pfam is an epimerisation domain.','{\"type\" : \"pfama\",\"text\" : \"E-Domain\",\"colour\" : \"#F4FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Epimerization'),(6,'Cy',0,NULL,NULL,'','',NULL),(7,'M',0,NULL,NULL,'','',NULL),(8,'Nm',0,'','','N-methylation-domain','{\"type\" : \"pfama\",\"text\" : \"A-Domain\",\"colour\" : \"#82FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",  \"endStyle\" : \"curved\"}','nMT'),(9,'Om',0,'','','O methylation domain','{\"type\" : \"pfama\",\"text\" : \"O-methylation-Domain\",\"colour\" : \"#82FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",  \"endStyle\" : \"curved\"}','oMT'),(10,'C_L',0,'','','Condensation Domain\r\nBuilds peptide bond between two amino acids, each covalenty bound to a thiolation domain. It has a specificity for the chirality of the donor amino acid and for the acceptor amino acid. Thus the latter specificity is the same as that of the following adenylation domain.\r\nPfam also recognises epimerisation domains as condensation domains.','{\"type\" : \"pfama\",\"text\" : \"C-Domain\",\"colour\" : \"#ff5353\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Condensation_LCL'),(11,'C_D',0,'','','Condensation Domain\r\nBuilds peptide bond between two amino acids, each covalenty bound to a thiolation domain. It has a specificity for the chirality of the donor amino acid and for the acceptor amino acid. Thus the latter specificity is the same as that of the following adenylation domain.\r\nPfam also recognises epimerisation domains as condensation domains.','{\"type\" : \"pfama\",\"text\" : \"C-Domain(D)\",\"colour\" : \"#ff5353\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Condensation_DCL'),(12,'NCOM',0,'','','N terminal communication domain','{\"type\" : \"pfama\",\"text\" : \"N-terminal-communication-Domain\",\"colour\" : \"#82FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",  \"endStyle\" : \"curved\"}','NRPS-COM_Nterm'),(13,'CCOM',0,'','','C-terminal communication domain','{\"type\" : \"pfama\",\"text\